package ua.ksstroy.converter.zone;import ua.ksstroy.converter.Converter;import ua.ksstroy.logic.zone.ZoneGroup;import ua.ksstroy.models.zone.GroupsModel;public class GroupsModelToGroupConverter implements Converter<GroupsModel, ZoneGroup> {    public ZoneGroup convert(GroupsModel group) {        ZoneGroup zoneGroup = new ZoneGroup();        zoneGroup.setId(group.getId());        zoneGroup.setName(group.getName());        return zoneGroup;    }}